import React from 'react';
import { useFonts } from 'expo-font';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import { Container, Roxo, Smartmobile } from "./styles/Login";

const Login = () => {
  const [loaded] = useFonts({
    MajorMonoDisplay: require('./fonts/MajorMonoDisplay-Regular.ttf'),
  });
  
  if (!loaded) {
    return null;
  }

    return (
        <Container>
          <Roxo>  <Smartmobile style={{ fontFamily: 'MajorMonoDisplay' }}> SmartMobile </Smartmobile> </Roxo>
        <Smartmobile style={{ fontFamily: 'MajorMonoDisplay' }}> SmartMobile </Smartmobile>
        <StatusBar backgroundColor="#677689" barStyle="light-content"/>
      </Container>
    );
  }
  
  export default Login;
